export const RouterSwitch = ({ children }) => {
    const activeRouter = window.stencilrouter.Context.activeRouter;
    const groupId = activeRouter.createGroup(children.length);
    const chil = children.map((child, index) => {
        child.vattrs.group = groupId;
        child.vattrs.groupIndex = index;
        return child;
    });
    return (h("div", null, chil));
};
